import ExpenseItem from "./ExpenseItem";
import './Expenses.css'
function Expenses() {
    return (
        <div>
            <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date} key={expenses[0].id}/>
        </div>
    );

}

export default Expenses;
